import React from "react";

function Row(props) {
  return (

    <div>
      {
        <tbody>
          <tr>
            <td>{props.first_name}</td>
            <td>{props.last_name}</td>
            <td>{props.gender}</td>
            <td>{props.email}</td>
            <td>{props.phone}</td>
            <td>{props.department}</td>
          </tr>
        </tbody>
      }
    </div>
  );
}

export default Row;
